import React from "react";

function Saludador({ empleado }) {
  return (
    <div className="flex flex-col text-black">
      <p className=" font-semibold">{`Hello ${empleado.nombre}`}</p>
      <p className="text-sm">{`${empleado.puesto}`}</p>
    </div>
  );
}

export default Saludador;
